import React from 'react';

import SortingVisalizer from './SortingVisualizer/SortingVisualizer';
import { BrowserRouter, Route, Switch, Redirect } from "react-router-dom";

import './App.css';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Route exact path='/' render={() => 
                (<SortingVisalizer/>)}/>
                </BrowserRouter>
    </div>
  );
}

export default App;
